script: |
  super -f text -I q11738.spq | sort > q11738.out

inputs:
  - name: q11738.spq
    data: |
      SELECT - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( + col2 ) NOT BETWEEN 64 * - 11 * CAST ( - col1 AS INTEGER ) AND + - 8;
  - name: tab2

outputs:
  - name: q11738.out
    data: |
      -23
      -40
      -58
